#!/usr/bin/env ruby

require_relative '../world-painter/world_painter.rb'

# Scan Katlyn's house

def scan_katlyn_house(painter, filename = 'scan.dat')
  xmin = 137
  xmax = 158
  ymin = 63
  ymax = 77
  zmin = 209
  zmax = 227
  xspan = xmax - xmin
  yspan = ymax - ymin
  zspan = zmax - zmin
  half_xspan = (xspan / 2).to_i
  half_yspan = (yspan / 2).to_i
  half_zspan = (zspan / 2).to_i

  painter.center = [xmin + half_xspan, ymin + half_yspan, zmin + half_zspan]

  File.open(filename, 'w') do |output|
    (-1 * half_xspan).upto(half_xspan) do |x|
      (-1 * half_yspan).upto(half_yspan) do |y|
        (-1 * half_zspan).upto(half_zspan) do |z|
          type = painter.test(x, y, z)
          line = "#{x} #{y} #{z} #{type}"
          puts line
          output.puts line
        end
      end
    end
  end
end

def read_dat(filename)
  memory = []
  File.read(filename).each_line do |line|
    x, y, z, *type = line.split(/\s+/)
    memory << [x.to_i, y.to_i, z.to_i, type.join(' ')]
  end

  # Sort so that we build bottom-up
  memory.sort! { |(x1, y1, z1, type1), (x2, y2, z2, type2)| y1 <=> y2 }

  memory
end

def make_house(painter)
  memory = read_dat('andrew/house.dat')

  ymin = memory.min_by { |(x, y, z, type)| y }
  ymax = memory.max_by { |(x, y, z, type)| y }
  yspan = ymax[1] - ymin[1]
  half_yspan = (yspan / 2).to_i

  memory.each do |x, y, z, type|
    if WorldPainter::TYPE_MAPPINGS[type]
      painter.place x, y + half_yspan - 4, z, WorldPainter::TYPE_MAPPINGS[type]
    else
      puts "unknown: #{type}"
    end
  end
end

def andrew_pos(painter)
  painter.player_position('tectonic_earth')
end

